  FaPython,
  FaNode,
  FaCss3,
  FaGit,
} from "react-icons/fa";
import { MdJavascript } from "react-icons/md";
import { BiLogoFlutter, BiLogoTailwindCss } from "react-icons/bi";
function Skills() {
  const ICON_SIZE = 100;
  return (
    <div className=" p-20">
      <h1 className="text-5xl">Skills</h1>
      <div className="grid gap-4 grid-cols-4 mt-20 justify-items-center hover:bg-sky-700">
        <FaHtml5 size={ICON_SIZE} />
        <FaGit size={ICON_SIZE} />
        <FaJava size={ICON_SIZE} />
        <FaPython size={ICON_SIZE} />
        <FaReact size={ICON_SIZE} />
        <BiLogoTailwindCss size={ICON_SIZE} />
        <FaNode size={ICON_SIZE} />
        <FaCss3 size={ICON_SIZE} />
        <BiLogoFlutter size={ICON_SIZE} />
        <MdJavascript size={ICON_SIZE} />
      </div>
    </div>
  );
}

export default Skills;
